column8:
適合車種：レガシィ<Br>
車輌形式：BM9<Br>
<Br>
■乗り心地最重視設計<Br>
セダンやミニバン、軽自動車それぞれにハンドリング性能を高めつつ、乗り心地を最重視するセッティングを施しました。また、バネレートはノーマルに比べ15％アップまでに抑え、乗り心地に反映させています。<Br>
【For セダン】<Br>
スポーツ系はハンドリングのシャープさを、フォーマル系では乗り心地を重視しました。フロント、リア共に荷重に応じた最適なバネレートセッティングを施しています。<Br>
【For ミニバン/軽自動車】<Br>
フォルム、バネレート共にそれぞれの車種の性格に合わせてセッティングしました。快適な乗り心地はそのままにスポーティーカーに負けないハンドリングをミニバン/軽自動車で実現しています。<Br>
<Br>
■3年間5万キロ保証<Br>
安心してお客様がお買い求め頂けるように、ヘタリ保証制度を導入しております。最高級素材（SAE9254及びSWOSC-B）を仕様しているがゆえの自信でもあります。
（保証内容：お客様は当製品をご使用された際、下記保証に関して弊社規定に基づき新品と交換させて頂くという制度です。）<Br>
【車高に関する保証】<Br>
弊社が定めるダウン量（カタログ表示値）より下がらない場合、道路交通法に基づき最低地上高基準値を確保出来ない場合（マフラー、タイヤ、ホイールなど純正部品での基準値）において、新品と交換させて頂きます。ディーラー（メーカー）オプションにてローダウン仕様のお車があります。この場合はカタログ表示値通りに下がらない場合があります。ご注意ください。<Br>
【商品破損に関する保証】<Br>
車輌に商品取付後、商品自体が破損した場合において新品と交換させて頂きます。<Br>
※保証対象外となる事項及び詳細内容は「保証規程」をご参照ください。<Br><Br>

